import React, { useEffect, useState } from 'react'
import { Link, useParams } from 'react-router-dom'
import './clubbystudent.css';
import StudentHeading from '../../common/heading/studentheading/StudentHeading';
import axios from 'axios'

const ClubProfileStudent = () => {
    const { club } = useParams();

    const [clubData, setClubData] = useState([]);

    useEffect(() => {
        // Fetch data from the server when the component mounts
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            // Make a GET request to your server endpoint
            const response = await axios.get('http://localhost:8081/members/'+club);
            alert('Club initiaited')
            alert(response)
            console.log('API Response:', response.data);
            // Assuming the response.data is an array of club data
            setClubData(response.data);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };
    return (
        <div>
            <StudentHeading />
            <div className='profile-banner'>
                <div className='profile-image'></div>
                {clubData.map((club, index) => (
                <div className='profile-heading' key={index}>
                    <p className='profile-title-1'>{club.club}</p>
                    <p className='profile-club-domain'>{club.domain}</p>
                </div>
                ))}
            </div>
            <div className='profile-content'>
                <p className='title'><center>About Us</center></p>
                <p><center>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Provident aut fugit reiciendis officiis voluptatem quas? Dicta voluptas deleniti, saepe doloribus consequatur, alias nesciunt possimus officia, doloremque reiciendis cupiditate facere dolores.</center></p>
                <div className='club-head'>
                    <p className='title'><center>Meet The Club Leads!</center></p>
                    <div className='profile-cards'>
                    {clubData.map((clubItem, index) => (
                        <div className='profile-card-text' key={index}>
                            <section className='circular-card'></section>
                            <section><p className='club-head-name'>{clubItem.head}</p></section>
                            <section><p className='club-head-srn'>{clubItem.srn}</p></section>
                        </div>
                    ))}
                    </div>
                </div>
                <div className='events'>
                    <p className='title'><center>Upcoming Events</center></p>
                </div>

            </div>
            <section className='event-banner'></section>
            <div className='event-registration'>
                <div className='event-registration-left'>
                    <p className='profile-title-event'>Event Name</p>
                    <Link to='/'><button type='submit' className='register-button'>Register</button></Link>
                </div>
                <div className='event-registration-right'>
                    <p className='event-element'>Lorem ipsum dolor sit amet consectetur adipisicing elit. Distinctio minima ipsa alias explicabo animi dolor quod consequuntur, illum eligendi nihil magni sunt quibusdam culpa neque quos ullam non quas itaque!</p>
                    <br></br>
                    <p className='event-element'>Date: xx/xx/xxxx</p>
                    <p className='event-element'>Timings: xx:xx - xx:xx</p>
                    <p className='event-element'>Venue: xx</p>
                    <br></br><br></br>
                </div>
            </div>
        </div>
    )
}

export default ClubProfileStudent
